import React from "react";
import data from "../../data";
function ReviewSummaryAddImg() {
  const cardData = [
    {
      imgUrl: "/images/Frame4.svg",
      mainTitle: "VISUAL",
      starImg: [
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
      ],
    },
    {
      imgUrl: "/images/Frame.png",
      mainTitle: "OLFACTORY",
      starImg: [
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
      ],
    },
    {
      imgUrl: "/images/Frame2.png",
      mainTitle: "TASTE",
      starImg: [
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
      ],
    },
    {
      imgUrl: "/images/Frame3.png",
      mainTitle: "SMOKEABILITY",
      starImg: [
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
      ],
    },
    {
      imgUrl: "/images/Group4.png",
      mainTitle: "EFFECT",
      starImg: [
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
        `${data[0].vector2}`,
      ],
    },
  ];

  const card = cardData.map((data) => (
    <section key={data.imgUrl} className="bg-[#E8E7D8] rounded-xl">
      <div className="grid grid-cols-8 xss:gap-3 p-4 relative">
        <div className="xs:col-span-2 xss:col-span-8 grid place-content-center">
          <img src={data.imgUrl} alt="imgurl" className="max-h-16" />
        </div>
        <div className="flex ml-7 xs:col-span-6 xss:col-span-8">
          <div className="">
            <h2 className="text-[#3B2B2F] text-2xl break-all">
              {data.mainTitle}
            </h2>
            <p className="flex text-[#5D5C56] text-sm font-family font-medium -mt-1">
              <span className="after:content-['.'] after:font-bold after:ml-1">
                4 Categories
              </span>
              <span>18 Starts</span>
            </p>
            <div className="flex gap-1 pt-1 ">
              {data.starImg.map((star) => (
                <img
                  key={Math.random()}
                  src={star}
                  className="w-[1.5rem] h-[1.4rem]"
                />
              ))}
            </div>
          </div>
          <p className="absolute right-5 top-3 text-[#3B2B2F] text-sm font-semibold font-family mt-1">
            EDIT
          </p>
        </div>
      </div>
    </section>
  ));

  return (
    <section className="grid place-items-center my-5">
      <div className="max-w-[30rem] w-full grid gap-5 p-4">
        {/* 
      ///////////Add Image////////
      ////////////////////////// */}
        <div className="flex flex-row gap-1 justify-start items-center">
          <div className="w-[4.5rem] h-[4.5rem] bg-[#C4C4C4] grid place-content-center">
            <h2 className="font-family font-bold text-xs text-center">
              ADD IMAGE
            </h2>
          </div>
          <div>
            <p className="text-3xl font-medium text-[#3B2B2F]">DOJA - C99</p>
            <p className="text-[#A7AE45] text-lg -mt-1.5 font-normal">
              LOT# : 2202010809
            </p>
          </div>
        </div>
        <p className="text-3xl text-[#3B2B2F] -mb-5">REVIEW SUMMARY</p>

        {/* 
      ///////////Review Summary////////
      ////////////////////////// */}
        <div className="flex flex-col gap-3">{card}</div>
        <button className="px-8 py-5 bg-[#3B2B2F] text-[#E8E7D8] rounded-xl text-2xl font-bold font-family text-center cursor-pointer">
          Start Review
        </button>
      </div>
    </section>
  );
}

export default ReviewSummaryAddImg;
